import './style.css';
import React from 'react';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Header from './header.jsx';
import Main from './main.jsx';
import Footer from './footer.jsx';


import Twelve_notes_albom from './twelve_notes_albom.jsx';
import These_Two_Windows from './these_two_windows_albom.jsx';







function App() {
  return (
    <>
        <BrowserRouter>
          <Header/>
          <Routes>
              <Route path='/' element={<Main/ >}/>


              <Route path='/twelve_notes_albom' element={<Twelve_notes_albom/>}/>


              {/* <Route path='/twelve_notes_albom/song/:id' element={<Twelve_notes_albom />} /> */}
              <Route path='/song/:id' element={<Tw_notes_song/>} />
              <Route path='/song/:id' element={<Ways_to_go_song/>} />
              <Route path='/song/:id' element={<In_a_little_song/>} />
              <Route path='/song/:id' element={<Different_kind_of_beautiful_song/>} />
              <Route path='/song/:id' element={<Pick_me_song/>} />
              <Route path='/song/:id' element={<Sacrifice_tomorrow_song/>} />
              <Route path='/song/:id' element={<I_sent_my_therapist_to_therapy_song/>} />
              <Route path='/song/:id' element={<The_arsonist_song/>} />
              <Route path='/song/:id' element={<Lead_me_to_water_song/>} />
              <Route path='/song/:id' element={<By_now_song/>} />
              <Route path='/song/:id' element={<King_size_bed_song/>} />
              <Route path='/song/:id' element={<Love_the_ones_who_leave_song/>} />



              <Route path='/these_two_windows_albom' element={<These_Two_Windows/>}/>

{/* 
              <Route path="/these_two_windows_albom/song/:id" element={<These_Two_Windows />} /> */}
              <Route path='/song/:id' element={<Mind_is_a_prison_song/>} />
              <Route path='/song/:id' element={<Demons_song/>} />
              <Route path='/song/:id' element={<Oh_my_god_song/>} />
              <Route path='/song/:id' element={<The_book_of_you_and_i_song />} />
              <Route path='/song/:id' element={<Match_in_the_rain_song/>} />
              <Route path='/song/:id' element={<Jesus_in_la_song/>} />
              <Route path='/song/:id' element={<I_am_not_a_cynic_song/>} />
              <Route path='/song/:id' element={<Alamo_song/>} />
              <Route path='/song/:id' element={<Must_have_been_the_wind_song/>} />
              <Route path='/song/:id' element={<Just_like_you_song/>} />


          </Routes>
          <Footer/>
        </BrowserRouter>    
    </>
  );
}

export default App;
